import React, { Component } from 'react';
import Pusher from 'pusher-js';

class Stall extends Component {
  constructor(props) {
    super(props);
    this.state = {
      occupants: [],
    };
  }

  componentDidMount() {

  }

  updateOccupants(member) {
    this.setState({
      visitors: [...this.state.occupants, member],
    })
  }

  render() {
    return (
      <div id="stall">
        Currently in stall: {this.state.occupants.length}
      </div>
    );
  }

}

export default Stall;
